import  {Routes, Route} from 'react-router-dom'
import SignIn from '../pages/SignIn'
import SignUp from '../pages/SignUp'
import Dashboard from '../pages/Dashboard'
import Profile from '../pages/Profile'
import Costumers from '../pages/Costumers'
import New from '../pages/New';
import ProtectedRoute from './protectedRoute'

export default function MyRoutes(){
  return(
    <Routes>
      <Route exact path='/' element={<SignIn/>}/>
      <Route exact path='/register' element={<SignUp/>}/>
      <Route ProtectedRoute exact path='/dashboard' element={<Dashboard/>}/>
      <Route ProtectedRoute exact path='/profile' element={<Profile/>}/>
      <Route ProtectedRoute exact path='/costumers' element={<Costumers/>}/>
      <Route ProtectedRoute exact path='/new' element={<New/>}/>
    </Routes> 
  );
}
